import React,{Component} from 'react';

function BookCard ({book_name,book_authors}) {
   return(
       <div>
           <div className="book-title">
                {book_name}
            </div>
            {book_authors.map((book_author, i) => {
                return (
                    <div className="book-author">{book_author}</div>
                ) })}
       </div>
   ) 
}
export default BookCard;
